import React from 'react';
import GoogleMapReact from 'google-map-react';
const Marker = ({ text }) => <div>{text}</div>;

class MapView extends React.Component {
  static defaultProps = {
    center: {
      lat: 40.73,
      lng: -73.93
    },
    zoom: 14
  }
  render(){
    let parkingSpots= this.props.parkingSpots.map(spot=> <Marker lat={spot.lat} lng={spot.lng}/>)
    return(
      <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact bootstrapURLKeys={{ key: "AIzaSyDS7fqSLY5L2xuXAb8cIb1vyQRKt5EPXmw" }}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}>
          <Marker lat={59.955413}
            lng={30.337844}
            text="My Marker"/>
            {parkingSpots}
        </GoogleMapReact>
      </div>
    )
  }
}

export default MapView
